import React from "react";
import Navbar from "./Navbar";
import Footer from "./Footer";
import { Outlet } from "react-router-dom";

function Layout() {
  return (
    <>
      <Navbar />
      <div>
        {scroll > 500 && (
          <button
            style={{
              position: "fixed",
              right: "50px",
              bottom: "50px",
              padding: "16px",
            }}
            onClick={moveToTop}
          >
            Scroll to Top
          </button>
        )}
      </div>
      <Outlet />
      <Footer />
    </>
  );
}

export default Layout;
